fun TransactionResponseBody.toTransactionUI() =
    TransactionUI(
        id = id,
        publicId = publicId,
        amount = amount,
        type = type,
        status = status,
        origin = origin,
        merchant = merchant.toMerchantUI(),
        card = card?.toCardUI(),
        account = account.toAccountUI(),
        category = category,
        attachments = attachments.map { it.toAttachmentUI() },
        createDate = createDate,
        completeDate = completeDate
    )



fun MerchantResponseBody.toMerchantUI() =
    MerchantUI(
        icon = icon,
        name = name
    )

fun CardResponseBody.toCardUI() =
    CardUI(
        id = id,
        cardLast4 = cardLast4,
        cardName = cardName,
        isLocked = isLocked,
        isTerminated = isTerminated,
        spent = spent,
        limit = limit,
        limitType = limitType,
        cardHolder = cardHolder.toTransactionCardHolderUI(),
        fundingSource = fundingSource,
        issuedAt = issuedAt
    )

fun CardHolder.toTransactionCardHolderUI() =
    TransactionCardHolderUI(
        email = email,
        fullName = fullName,
        id = id,
        logoUrl = logoUrl
    )

fun AccountResponseBody.toAccountUI() =
    AccountUI(
        accountName = accountName,
        accountLast4 = accountLast4,
        accountType = accountType
    )


fun AttachmentResponseBody.toAttachmentUI() =
    AttachmentUI(
        id = id,
        transactionId = transactionId,
        externalTransactionId = externalTransactionId,
        note = note,
        fileUrl = fileUrl,
        fileName = fileName,
        fileSize = fileSize,
        fileType = fileType,
        sourceId = sourceId,
        createdAt = createdAt,
        updatedAt = updatedAt,
        deletedAt = deletedAt
    )

